import { navigation } from "../../constants";

export const Header = () => {
  return (
    <header className="header">
      <p>LOGO</p>
      {navigation.map((nav, index) => (
        <link key={index} href="#">
          {nav}
        </link>
      ))}
    </header>
  );
};
